import "./App.css";

const Conference = () => {
    const userImage = "https://i.postimg.cc/zDy6rN8J/temp-Image-Auq-Ya-Y.avif";
    const conferenceName = "Конференция по теме Дота 2"
    const conferenceAdmin = "zxcSf10KMMR"

  return (
    <div className="Conference">
      <div className="header-box">
        <div className="header-text">Конференции</div>
      </div>
      <div className="conference-box">
        <img className="user-image" src={userImage} alt="userImage" />
        <div className="conference-name">{conferenceName}</div>
        <div className="conference-admin">Проводит: {conferenceAdmin}</div>
      </div>
    </div>
  );
};

export default Conference;
